    <script type="nojs" id="fragmentShaderText">
        precision mediump float;
        varying vec4 vColor;
        varying vec4 vNormal;
        varying vec2 vTex;

        uniform sampler2D uSampler;

        const vec3 light = normalize(vec3(1.0,1.0,1.0)); 
    


        void main(void) {
            float dot_i = dot(normalize(vec3(vNormal)), light);
            gl_FragColor = vec4(vec3(texture2D(uSampler, vec2(vTex.s, vTex.t))) * max(dot_i, 0.0), 1.0);
           // gl_FragColor = texture2D(uSampler, vec2(vTex.s, vTex.t));
        
        }
    </script>
    <script type="nojs" id="vertexShaderText">
        attribute vec4 position;
       // attribute vec4 color;
        attribute vec4 normal;
        attribute vec2 tex;

        uniform mat4 u_matrix;

        varying vec4 vColor;
        varying vec4 vNormal;
        varying vec2 vTex;

        void main(void) {
            gl_Position = u_matrix * position + vec4(0.0, -20.0, 0.0, 1.0);
           // vColor = color;
            vNormal = normalize(u_matrix * normal);
            vTex = tex;
           // vColor = normal;
        }
    </script>
